import "./App.css";
import useState from "react";

function App() {
  const [isPlaying, setIsPlaying] = useState(false);

  function togglePlay() {
    setIsPlaying(!isPlaying);
  }
  return (
    <div className="App">
      <p>Oma's voicemails</p>
      <button onClick={togglePlay}>Voicemail 1</button>
    </div>
  );
}

export default App;
